import {Button} from '@material-ui/core'
export default function App() {
  const [color,setColor] =useState('success')
  const handleClick=()=>{
        setColor('danger')
  }
  return (
    <div>
                 <Button color={color} variant='outlined' onClick={handleClick}>Default</Button>
    </div>
  )
}
